import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
const name="Neha Garg";

const currDate=new Date().toLocaleDateString();
const currTime=new Date().toLocaleTimeString();
const img1="https://picsum.photos/200/300";
const img2="https://picsum.photos/250/300";
const img3="https://picsum.photos/270/300";
const img4="https://picsum.photos/300/300";
ReactDOM.render(
<>
<h1 className="heading"> Hi! My name is {name}</h1>
<p>Today date is {currDate}</p>
<p>Current Time is {currTime}</p>
<img src={img1} alt="gfcg" />
<img src={img2} alt="gfcg" />
<img src={img3} alt="gfcg" />
<img src={img4} alt="gfcg" />
</>,document.getElementById("root"));
